void pinkLaplacian(const unsigned short int image[240][320]) {
    // Iterate through each pixel in the image, excluding border pixels
    for (int i = 1; i < 239; ++i) {
        for (int j = 1; j < 319; ++j) {
            int sum = 0;

            // Compute the Laplacian operator
            for (int m = -1; m <= 1; m += 2) {
                for (int n = -1; n <= 1; n += 2) {
                    // Use boundary check:
                    sum += image[i + m][j + n];
                }
            }
            
            // Calculate the Laplacian result
            int temp = image[i][j] * 4 - sum;

            // Handle excess values:
            if (temp > 31) temp = 31;
            if (temp < 0) temp = 0x0;

            // Store the Laplacian value
            edges[i][j] = (temp << 11) | (temp << 5) | temp;
        }
    }
}

void sobel1(const unsigned short int image[240][320]){
	// Sobel operator kernels
	int sobel_x[3][3] = {{-1, 0, 1}, {-2, 0, 2}, {-1, 0, 1}};
	// to detect the horizontal edges
	int sobel_y[3][3] = {{-1, -2, -1}, {0, 0, 0}, {1, 2, 1}};
	// to detect the vertical edges
	
	// Perform convolution with Sobel operator
	for (int y = 1; y < MAX_Y - 1; y++) {
    	for (int x = 1; x < MAX_X - 1; x++) {
        	int gradient_x = 0;
        	int gradient_y = 0;

        	// Compute gradient in x direction
        for (int ky = -1; ky <= 1; ky++) {
            for (int kx = -1; kx <= 1; kx++) {
                gradient_x += image[y + ky][x + kx] * sobel_x[ky + 1][kx + 1];
            }
        }

        // Compute gradient in y direction
        for (int ky = -1; ky <= 1; ky++) {
            for (int kx = -1; kx <= 1; kx++) {
                gradient_y += image[y + ky][x + kx] * sobel_y[ky + 1][kx + 1];
            }
        }

        // Compute magnitude of gradient
        edges[y][x] = abs(gradient_x) + abs(gradient_y);
    	}
	}	
}

void sobel2(const unsigned short int image[240][320]) {
    int square[9], temp1, temp2;
    
    // Iterate through each pixel in the image, excluding border pixels
    for (int i = 1; i < 239; ++i) {
        for (int j = 1; j < 319; ++j) {
            int index = 0;
            
            // Record the values in the 3x3 square:
            for (int m = -1; m <= 1; ++m) {
                for (int n = -1; n <= 1; ++n) {
                    // Use boundary check:
                    square[index++] = image[i + m][j + n];
                }
            }
            
            // Calculate gradients using Sobel operator
            temp1 = abs(square[2] + 2 * square[5] + square[8] - square[0] - 2 * square[3] - square[6]);
            temp2 = abs(square[6] + 2 * square[7] + square[8] - square[0] - 2 * square[1] - square[2]);
            
            // Compute magnitude of gradient
            edges[i][j] = sqrt(temp1 * temp1 + temp2 * temp2);
        }
    }
}

// Function to convert a 2D array of short int RGB values to grayscale
void rgb_to_grayscale(const unsigned short int rgb[240][320]) {
    for (int y = 0; y < 240; y++) {
        for (int x = 0; x < 320; x++) {
            // Extract RGB components 
            unsigned short int b = rgb[y][x] & 0x1F;        // Blue component
			unsigned short int g = (rgb[y][x] >> 5) & 0x3F;   // Green component
            unsigned short int r = (rgb[y][x] >> 11) & 0x1F;  // Red component
            
            // Compute luminance (weighted sum of RGB channels) for grayscale image
            unsigned short int gray = (unsigned short int)((0.2126 * r) + (0.7152 * g) + (0.0722 * b));
			
            // Store grayscale value
            grayscale[y][x] = (gray<<11) | (gray<<5) | gray;
        }
    }
}

// brightness_change value can go between -63 and 63 for maximum and minimum brightness
void adjust_brightness(const unsigned short int rgb[240][320], int brightness_change) {
    // Iterate over each pixel in the 320x240 array
    for (int x = 0; x < 320; x++) {
        for (int y = 0; y < 240; y++) {
            // Extract RGB components from the current pixel
            unsigned short int r = (rgb[y][x] >> 11) & 0x1F;  // Red component
            unsigned short int g = (rgb[y][x] >> 5) & 0x3F;   // Green component
            unsigned short int b = rgb[y][x] & 0x1F;          // Blue component

            // Adjust brightness for each component
			//can't allow the rgb values to go above 31 (for r and b) or 63 (for g) or below 0
            r = (r + brightness_change > 31) ? 31 : (r + brightness_change < 0) ? 0 : r + brightness_change;
            g = (g + brightness_change > 63) ? 63 : (g + brightness_change < 0) ? 0 : g + brightness_change;
            b = (b + brightness_change > 31) ? 31 : (b + brightness_change < 0) ? 0 : b + brightness_change;

            // Combine the adjusted RGB components into a single RGB value
            bright[y][x] = (r << 11) | (g << 5) | b;
        }
    }
}

// Function to convert a grayscale image to RGB
void grayscale_to_rgb(const unsigned short int grayscale[240][320]) {
    for (int i = 0; i < 240; ++i) {
        for (int j = 0; j < 320; ++j) {
            // Copying grayscale intensity value to all RGB channels
            rgb[i][j] = grayscale[i][j] | (grayscale[i][j] << 5) | (grayscale[i][j] << 11);
        }
    }
}


int switchInput(){
	volatile int *SW_ptr = (int*)SW_BASE;
	int value = *(SW_ptr);
	
	int sign = value & 0x1;
	
	if(sign){
		value = value/16;
		return value;
	} else {
		value = value / 16;
		return -value;
	}
	
}


/* CODE FOR INTERRUPTS */


void config_PS2(void){
    volatile int *PS2_ptr = (int *)PS2_BASE;
    *(PS2_ptr) = 0xff; //reset 
    *(PS2_ptr + 1) = 0x1; //enable interrupts from PS2 by setting RE to 1
}

void config_KEYS(){
  volatile int *KEY_ptr = (int *)KEY_BASE; // address for the pushbuttons
  *(KEY_ptr + 2) = 0x3; // enable interrupts for all pushbuttons
}


void enableInterrupts(int IRQ) {
    //allow KEYS to cause interrupts but disable interrupts from PS/2
  if(IRQ == 1){
    NIOS2_WRITE_IENABLE(0x2);
  //allow PS/2 to cause interrupts but disable interrupts from KEYS
  } else if (IRQ == 7){
    NIOS2_WRITE_IENABLE(0x80);
  } else {
  //allow IRQ 1 (keys) and IRQ 7 (PS/2) to cause interrupts
  NIOS2_WRITE_IENABLE(0x82);
  }
  // enable interrupts in NIOS II turn on the pie bit
  NIOS2_WRITE_STATUS(0x1);
}


void disableInterrupts(){
  // disable ALL interrupts by setting pie bit to 0
  NIOS2_WRITE_STATUS(0x0);
}


void ps2_ISR(void) {
  unsigned char byte1 = 0, byte2 = 0, byte3 = 0;

  volatile int *PS2_ptr = (int *)PS2_BASE;
  int PS2_data, RVALID;

  PS2_data = *(PS2_ptr);  // read data register in the PS / 2 port
  RVALID = (PS2_data & 0x8000); // flag indicating if valid data is present

  if(RVALID){
        //reading from the reg provides the data at the head of the FIFO in the data field
        // it also decrements the data register field by 1
        //reading RAVAIL provides number of entries in the FIFO
      byte1 = byte2; // to keep track of the recent history of key presses/releases
      byte2 = byte3;
      byte3 = PS2_data & 0xFF;

      volatile unsigned int compareBytes;

      compareBytes = (byte2 << 8) | byte3;
	  
      //break code
      if (compareBytes == (char) 0xf05a) { // enter key
	  	  capture = 1;
	  } else if(compareBytes == (char) 0xf024){ //E key 
          edgeDetection = 1;
		  original = 0;
		  brightness = 0;
		  switchColours = 0;
		  laplacian = 0;
		  
      } else if (compareBytes == (char) 0xf032){ //B key
          brightness = 1;
		  original = 0;
		  edgeDetection = 0;
		  switchColours = 0;
		  laplacian = 0;
		  
      } else if (compareBytes == (char) 0xf04b){ //L key
          brightness = 0;
		  original = 0;
		  edgeDetection = 0;
		  switchColours = 0;
		  laplacian = 1;
		  
      } else if (compareBytes == (char) 0xf029){ // Space Bar
        spaceBarPressed = 1;
		  
      } else if (compareBytes == (char) 0xf044){ // key o
		  original = 1;
		  edgeDetection = 0;
		  brightness = 0;
		  switchColours = 0;
		  laplacian = 0;
		  
	  } else if (compareBytes == (char) 0xf076){ // esc
		  returnToMain = 1;
		  
	  } else if (compareBytes == (char) 0xf03a) { // key m
        mirrorFilter = 1;
        invertFilter = 0;
        sepiaFilter = 0; 
        demonFilter = 0;
        randomFilter  = 0;

      } else if (compareBytes == (char) 0xf043) { // key i
        mirrorFilter = 0;
        invertFilter = 1;
        sepiaFilter = 0; 
        demonFilter = 0;
        randomFilter  = 0;
      } else if (compareBytes == (char) 0xf01b) { // key s
        mirrorFilter = 0;
        invertFilter = 0;
        sepiaFilter = 1; 
        demonFilter = 0;
        randomFilter  = 0;
      } else if (compareBytes == (char) 0xf02d) { // key r
        mirrorFilter = 0;
        invertFilter = 0;
        sepiaFilter = 0; 
        demonFilter = 1;
        randomFilter  = 0;
      } else if (compareBytes == (char) 0xf04d) { // key p
        mirrorFilter = 0;
        invertFilter = 0;
        sepiaFilter = 0; 
        demonFilter = 0;
        randomFilter  = 1;
      } else if (compareBytes == (char) 0xf066){ // delete/backspace
		backspace = 1;
		  
	  } else if (compareBytes == (char)0xf016){ // key 1
		  imageNumber = 1;
		  capture = 0;
		  
	  } else if (compareBytes == (char)0xf01e){ // key 2
		  imageNumber = 2;
		  capture = 0;
	  } else if (compareBytes == (char)0xf026){ // key 3
		  imageNumber = 3;
		  capture = 0;
	  } else if (compareBytes == (char)0xf025){ //key 4
		  imageNumber = 4;
		  capture = 0;
	  } else if (compareBytes == (char)0xf021){ // key c
		  
			edgeDetection = 0;
		  	original = 0;
		  	brightness = 0;
		  	switchColours = 1;
		  	laplacian = 0;
			  
	  } else if (compareBytes == (char) 0xe0f072) { // up
			if (ySpritePosition < 240) ySpritePosition++;
			printf("%d\n", ySpritePosition);

	  } else if (compareBytes == (char) 0xe0f075) { // down
			if (ySpritePosition > 0) ySpritePosition--;

			printf("%d\n", ySpritePosition);
	  } else if (compareBytes == (char) 0xe0f06b) { // left
			if (xSpritePosition > 0) xSpritePosition--;

			printf("%d\n", xSpritePosition);
	  } else if (compareBytes == (char) 0xe0f074) { // right
			if (xSpritePosition < 320) xSpritePosition++;
			printf("%d\n", xSpritePosition);

	  } else if (compareBytes == (char) 0xf059) { // shift
			saveCapture = 1;

	  } else if (compareBytes == (char) 0xe0f071) {
			clearCapture = 1;

	  } else if (compareBytes == (char) 0xf031) { // n key
			if (spriteCounter == 8) spriteCounter = 0;
			else spriteCounter++;
			printf("%d", spriteCounter);
	  }
	  
    }
    return;
}


void pushbutton_ISR(void){
  volatile int* KEY_ptr = (int*)KEY_BASE;
  int press;

  press = *(KEY_ptr + 3); // read pushbutton interrupt reg
  *(KEY_ptr + 3) = press; // clear the interrupt

  if(press & 0x1){
    //key 0 was pressed
    key0Pressed = 1;
  } else if (press & 0x2){
    key1Pressed = 1;
  }

}

